[{"location":"","page":"Home","title":"Home","text":"CurrentModule = SchlierenReconstructions","category":"page"},{"location":"#SchlierenReconstructions.jl","page":"Home","title":"SchlierenReconstructions.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for SchlierenReconstructions.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [SchlierenReconstructions]","category":"page"},{"location":"#SchlierenReconstructions.LSQR","page":"Home","title":"SchlierenReconstructions.LSQR","text":"LSQR <: AbstractSolver\n\nFlag object for the multiple dipatch for function solve. solve(prob, LSQR()) means that prob will be solved with the LSQR method (Paige & Saunders (1982) \"LSQR: An Algorithm for Sparse Linear Equations and  Sparse Least Squares,\" ACM Transactions on Mathematical Software 8(1) 43-71. doi: 10.1145/355984.355989)\n\n\n\n関数solveの多重ディスパッチ用のフラグオブジェクト． solve(prob, LSQR())は，probがLSQR法で解かれることを意味する．\n\n\n\n\n\n","category":"type"},{"location":"#SchlierenReconstructions.LeastSquaresProblem","page":"Home","title":"SchlierenReconstructions.LeastSquaresProblem","text":"LeastSquaresProblem(operator, bvec)\n\nStoring information on a least squares problem mathrmargmin_boldsymbolx leftVert boldsymbolb - Aboldsymbolx rightVert_2^2\n\noperator::T where T<:AbstractOperator corresponding to A in mathbbR^mtimes n\nbvec::T where T<:Vector corresponding to boldsymbolb in mathbbR^m\n\n\n\n最小二乗問題 mathrmargmin_boldsymbolx leftVert boldsymbolb - Aboldsymbolx rightVert_2^2 についての情報を保存する構造体．\n\noperator::T where T<:AbstractOperator はA in mathbbR^mtimes nに対応\nbvec::T where T<:Vector はboldsymbolb in mathbbR^mに対応\n\n\n\n\n\n","category":"type"},{"location":"#SchlierenReconstructions.MatrixOperator","page":"Home","title":"SchlierenReconstructions.MatrixOperator","text":"MatrixOperator(A, dim_range, dim_domain) <: AbstractOperator\n\nFlag object for the multiple dipatch of op! and op_adj!.\n\nop!(y, x, MatrixOperator(A)) means that y = A*x,\n\nA <: Matrix corresponds to A in mathbbR^mtimes n\ndim_range corresponds to m (dimension of y)\ndim_domain corresponds to n (dimension of x)\n\n\n\n関数op!, op_adj!の多重ディスパッチのためのフラグオブジェクト． op!(y, x, MatrixOperator(A))は，y = A*xの計算をすることを意味する．\n\nA <: Matrix,  A in mathbbR^mtimes n\ndim_range, m (yの次元)\ndim_domain, n (xの次元)\n\n\n\n\n\n","category":"type"},{"location":"#SchlierenReconstructions.solve-Tuple{LeastSquaresProblem, LSQR}","page":"Home","title":"SchlierenReconstructions.solve","text":"solve(prob::LeastSquaresProblem, solver::LSQR; ...)\n\nSolve a least squares problem prob with LSQR method. (Paige & Saunders (1982) \"LSQR: An Algorithm for Sparse Linear Equations and  Sparse Least Squares,\" ACM Transactions on Mathematical Software 8(1) 43-71. doi: 10.1145/355984.355989)\n\nNote: Implemented based on scipy.sparse.linalg.lsqr https://github.com/scipy/scipy/blob/v1.9.0/scipy/sparse/linalg/_isolve/lsqr.py#L96-L586\n\nn_step_max, the maximum number of iteration steps\nxvec_init, initial guess of the solution x (must be the same size as x)\n\n\n\n\n\n","category":"method"}]
